import React, { useState } from "react";
import { Navbar, Nav } from "rsuite";
import Nmims from "../../assets/Logo.png";
import AdminIcon from "@rsuite/icons/Admin";
import styled from "styled-components";
import HamburgerMenu from "react-hamburger-menu";

const Dashboard = () => {
    const [isOpen, setIsOpen] = useState(false);

  const handleClick = () => {
    setIsOpen(!isOpen);
  };
  return (
    <Wrapper>
      <Navbar>
        <Navbar.Brand href="/Dashboard" style={{ height: "100%" }}>
          <img src={Nmims} alt="loading" />
        </Navbar.Brand>
        <Nav>
          <Nav.Item>Company Listing</Nav.Item>
          <Nav.Item>Records</Nav.Item>
          <Nav.Item>Student Data</Nav.Item>
          <Nav.Item>Student Assesments</Nav.Item>
          <Nav.Item>View Queries</Nav.Item>
          <Nav.Item>Analytics</Nav.Item>
        </Nav>
        <Nav pullRight>
          <Nav.Item icon={<AdminIcon />}>UserName</Nav.Item>
        </Nav>
        <HamburgerMenuWrapper>
          <HamburgerMenu
            isOpen={isOpen}
            menuClicked={handleClick}
            width={18}
            height={15}
            strokeWidth={2}
            rotate={0}
            color='white'
            borderRadius={0}
            animationDuration={0.5}
          />
        </HamburgerMenuWrapper>
      </Navbar>
    </Wrapper>
  );
};

export default Dashboard;

const Wrapper = styled.div`
.rs-navbar{
    background-color: #AF1111;
    color:white;
    display: flex;
    align-items: center;
    img{
        background:white;
        width: 100%;

    }
    .rs-navbar-brand{
        padding: 0;
    }
    .rs-navbar-nav:nth-last-child(1){
        width: 30%;
        display: flex;
        align-items: center;
        justify-content: center;
        .rs-navbar-item{
            margin-right: 30px !important;
        }
    }
}

`;
const HamburgerMenuWrapper = styled.div`
  display: none;
  @media (max-width: 768px) {
    display: block;
    margin-left: auto;
    padding: 10px;
  }
`;
